import React, {useEffect, useState} from "react";
import {IEmployee} from "./models/IEmployee";
import axios from 'axios';
interface IProps {}
interface IState {
    employees : IEmployee[];
    errorMessage : string;
}

let Employees:React.FC<IProps> =() =>{
    let [employeeState,setEmployeeState] = useState<IState>({
        employees : []  as IEmployee[],
        errorMessage : ''
    });
    useEffect(()=>{
        let dataURL : string = `https://gist.githubusercontent.com/thenaveensaggam/2c0a106c0b66ef2c8f4eb2b2c8c31e6d/raw/416efcc2300afc13cd0aa6413b2de4918a50ad30/contacts-02-12-2020.json`;
        axios.get(dataURL).then((response) => {
            setEmployeeState({
                ...employeeState,
                employees : response.data
            });
        }).catch((error) => {
            setEmployeeState({
                ...employeeState,
                errorMessage : error.message
            });
        });
    },[]);

    return(
        <React.Fragment>
            <h2> Employees Components</h2>

        </React.Fragment>
    )
};
export default Employees;
